	this.frame_297 = function() {
		this.stop();
		createjs.Touch.enable(stage);
		
		stage.enableMouseOver();
		var mycanvas = this;//this.stop();
		
		var mycanvas = this;
		
		var globalXval;
		var globalYval;
		var mytargetarray = ["bound1"];
		var myXoffset,myYoffset;
		
		
			function initme() {
		             var i = 1;
				    var myobj = mycanvas["flower" + i];
					myobj.gotoAndStop(0);
					myobj.xpos = myobj.x;
					myobj.ypos = myobj.y;
					myobj["base"].cursor = "pointer";
					myobj["base"].addEventListener("mousedown", objectStartMove.bind(this));
					myobj["base"].addEventListener("pressmove", objectMove.bind(this));
					myobj["base"].addEventListener("pressup", objectCheckPostion.bind(this));
					myXoffset = myobj["base"].x;
					myYoffset = myobj["base"].y;
					//console.trace(mycanvas["obj" + i].name + " kkkkkkkkkkkkkkkkkkk ");
				     console.log(myXoffset + " myXoffset " + myYoffset + " myYoffset " );
				
			
			}
		      	
			function intersect(o1, o2) {
				var myreturn = false;
		
		
				var bounds1 = o1.getBounds();
				var bounds2 = o2.getBounds();
		
				bounds1.x = o1.x;
				bounds1.y = o1.y;
				bounds2.x = o2.parent.x + myXoffset;
				bounds2.y = o2.parent.y + myYoffset;
		         
				console.log(bounds1 + " bounds1 " + bounds2 + " bounds2 " );
				console.log(o2.parent.x + " o2.parent.x " + o2.parent.y + " o2.parent.y ");
		
				var myrect = bounds1.intersection(bounds2);
				if (myrect != null) {
					myreturn = true;
				}
				return myreturn;
			}
		
			function objectCheckPostion(evt) {
				var item = evt.currentTarget;
				item.drag = false;
				////
				var len = mytargetarray.length;
				var ishit = false;
				var mytarget;
				for (var i = 0; i < len; i++) {
					 mytarget = mycanvas[mytargetarray[i]];
					var myval = intersect(mytarget, item);
					if (myval == true) {
						ishit = true;
						break;
					}
				}
				////
				if (ishit) {
					item.removeAllEventListeners();
					item.parent.visible = false;
					mycanvas.logomc.playsound("s4");
					mycanvas.gotoAndPlay(mycanvas.currentFrame + 1);
					//mytarget.visible = true;
					//var mypos = mytargetarray.indexOf(mytarget.name);
					//mytargetarray.splice(mypos,1);
				} else {
					item.parent.x = item.parent.xpos;
					item.parent.y = item.parent.ypos;
				}
				////
				
			}
		
			function objectStartMove(evt) {
				
				
				var item = evt.currentTarget;
				
				var pt = item.parent.parent.globalToLocal(evt.stageX, evt.stageY);
		
				globalXval = pt.x - item.parent.x;
				globalYval = pt.y - item.parent.y;
				item.drag = true;
		
			}
		
		
			function objectMove(evt) {
				var item = evt.currentTarget;
				if (item.drag) {
					var pt = item.parent.parent.globalToLocal(evt.stageX, evt.stageY);
					item.parent.x = pt.x - globalXval;
					item.parent.y = pt.y - globalYval;
				}
			}
		
		
		initme();
	}
